t, soudain, il s'immobilise sur sa proie, il identifie une gestuelle, un port de la tête dont il pressent qu'ils pourraient lui devenir familiers. Alors, on s'approche, on est déjà dans la séduction, dans le désir d'emporter l'adhésion de l'autre à cette démarche. Assez vite, on sait si cela va marcher, si une histoire est possible. Et, dans ce cas, il y a la fébrilité, l'inquiétude d'une défaite, l'espoir d'une conquête, le ravissement des sourires partagés. Le chamin est sinueux, accidenté, mais il mène à la mer."

Philippe Besson, En l'absence des hommes

